/*Practica6*/
import React from "react";
/*Practica6  .svg*/
//import { ReactComponent as Img1 } from "../imagenes/img1.svg";
//import { ReactComponent as Img2 } from "../imagenes/img2.svg";
import { ReactComponent as Img3 } from "../imagenes/img3.svg";
/*Practica6 .jpg*/

import Image from "./Image";
import Img1 from "../imagenes/imagen1.jpg";
import Img2 from "../imagenes/imagen2.jpg";

export const Section = () => {
  return (
    <div>
      <div
        id="carouselExampleFade"
        className="carousel slide carousel-fade"
        data-bs-ride="carousel"
      >
        <div className="carousel-inner">
          <div className="carousel-item active">
            {/*Practica6*/}
            <Image
              //Uso de los PRODS
              src={Img1}
              className="img-circle"
              alt="..."
              width="500"
              height="300"
            />
          </div>
          <div className="carousel-item">
            <Image
              src={Img2}
              className="img-circle"
              alt="..."
              width="500"
              height="300"
            />
          </div>
          <div className="carousel-item">
            <Img3 className="img-circle" alt="..." width="500" height="300" />
          </div>
        </div>
        <button
          className="carousel-control-prev"
          type="button"
          data-bs-target="#carouselExampleFade"
          data-bs-slide="prev"
        >
          <span
            className="carousel-control-prev-icon"
            aria-hidden="true"
          ></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button
          className="carousel-control-next"
          type="button"
          data-bs-target="#carouselExampleFade"
          data-bs-slide="next"
        >
          <span
            className="carousel-control-next-icon"
            aria-hidden="true"
          ></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>
    </div>
  );
};
